import React, { useState } from 'react'
import { Button, Modal, Table } from 'antd';

export default function HistorialCitas({ historial }) {

    const [isModalOpen, setIsModalOpen] = useState(false);

    const showModal = () => {
        setIsModalOpen(true);
    };
    const handleOk = () => {
        setIsModalOpen(false);
    };
    const handleCancel = () => {
        setIsModalOpen(false);
    };

    const columns = [
        {
            title: 'Fecha',
            dataIndex: 'fecha',
            key: 'fecha_hora',
        },
        {
            title: 'Servicio',
            dataIndex: 'servicio',
            key: 'age',
        },
        // {
        //     title: 'Medico',
        //     dataIndex: 'medico',
        //     key: 'medico',
        //     render: ({ medico }) => <div>{medico.name}</div>
        // },
    ];

    return (
        <div>

            <Button size='small' type="link" onClick={showModal}>
                Ver historial completo
            </Button>

            <Modal title="Historial de citas" open={isModalOpen} onOk={handleOk} onCancel={handleCancel}>

                HistorialCitas
                {JSON.stringify(historial)}

                <Table dataSource={historial} columns={columns} />;

            </Modal>

        </div>
    )
}
